import React, { useState } from 'react';
import './App.css';
import Header from './Header';
import SearchFilters from './SearchFilters';
import DogList from './DogList';

function App() {
  const [filteredDogs, setFilteredDogs] = useState(placeholderDogs);

  const handleFilterChange = (event) => {
    const selectedFilter = event.target.value;
    // Placeholder filter logic (using breed as an example)
    const filteredDogs = placeholderDogs.filter(dog => dog.breed === selectedFilter);
    setFilteredDogs(filteredDogs);
  };

  return (
    <div className="App">
      <Header />
      <main>
        <SearchFilters breeds={placeholderBreeds} sizes={placeholderSizes} ages={placeholderAges} onFilterChange={handleFilterChange} />
        <DogList dogs={filteredDogs} />
      </main>
    </div>
  );
}

export default App;
